<script>
import { DxDataGrid } from "devextreme-vue/data-grid";
import ptMessages from "devextreme/localization/messages/pt.json";
import config from "devextreme/core/config";
import Procedimento from "../http/procedimento";
import Menu from "../http/menu";
import Incluir from "../http/incluir_registro";
import funcao from "../http/funcoes-padroes";
import Lookup from "../http/lookup";
import { locale, loadMessages } from "devextreme/localization";
import grid from "../views/grid.vue";
import notify from "devextreme/ui/notify";

export default {
  props: {
    cd_relatorioID: { type: Number, default: 0 },
    cd_documentoID: { type: Number, default: 0 },
    cd_item_documentoID: { type: Number, default: 0 },
  },

  components: {
    Procedimento,
    Menu,
    Incluir,
    grid,
    DxDataGrid,
  },

  data() {
    return {
      dataSourceConfig: {},
      relatorio: [],
      logoEmpresa: "",
      cd_empresa: localStorage.cd_empresa,
      carregaDoc: false,
      modelo_selecionado: [],
      modelos_relatorio: [],
    };
  },

  async created() {
    config({ defaultCurrency: "BRL" });
    loadMessages(ptMessages);
    locale(navigator.language);
    if (this.cd_empresa == 123) {
      // WORK
      this.logoEmpresa =
        "data:image/jpeg;base64,";
    } else if (this.cd_empresa == 140 || this.cd_empresa == 205) {
      // AGROPPAULO
      this.logoEmpresa =
        "data:image/jpeg;base64,";
    } else if (this.cd_empresa == 116) {
      // TOTAL CROMO
      this.logoEmpresa =
        "data:image/jpeg;base64,";
    } else if (this.cd_empresa == 148) {
      //SOBERANO
      this.logoEmpresa =
        "data:image/png;base64,";
    } else if (this.cd_empresa == 154) {
      //LIONS
      this.logoEmpresa =
        "data:image/jpeg;base64,";
    }
  },

  async mounted() {
    let dados_lookup_tipo_relatorio = await Lookup.montarSelect(
      localStorage.cd_empresa,
      2973,
    );
    this.modelos_relatorio = JSON.parse(
      JSON.parse(JSON.stringify(dados_lookup_tipo_relatorio.dataset)),
    );
    //await this.carregaDados();
  },

  methods: {
    async chamaRelatorio(e) {
      this.dataSourceConfig = e;
      await this.carregaDados();
      if (this.relatorio[0].Cod === 0) {
        notify(this.relatorio[0].Msg);
        return;
      }
      let pegaHTML = document.getElementById("meuID");
      const configuracoes = {
        cd_parametro: 0,
        cd_documento: e.cd_consulta,
        cd_item_documento: 0,
        cd_relatorio: 11,
        abre_baixa: "A",
      };
      const DocumentoEmPDF = await funcao.Export2PDF(pegaHTML, configuracoes);
      return "Relatório encontrado!";
    },

    async carregaDados() {
      let dados_relatorio = await Menu.montarMenu(
        localStorage.cd_empresa,
        0,
        666,
      ); // 1520 - pr_api_gera_processo_relatorio
      let RelatorioApi = dados_relatorio.nm_identificacao_api;
      let RelatorioSParametroApi = dados_relatorio.nm_api_parametro;

      let configuracoesM = {
        cd_parametro: 0,
        cd_documento: this.dataSourceConfig.cd_consulta,
        cd_item_documento: 0,
        cd_relatorio: 11,
        abre_baixa: "A",
      };

      localStorage.cd_parametro = configuracoesM.cd_parametro;
      localStorage.cd_documento = configuracoesM.cd_documento;
      localStorage.cd_item_documento = configuracoesM.cd_item_documento;
      localStorage.cd_relatorio = configuracoesM.cd_relatorio;

      this.relatorio = await Procedimento.montarProcedimento(
        localStorage.cd_empresa,
        0,
        RelatorioApi,
        RelatorioSParametroApi,
      );
    },
  },
};
</script>

